// 初始化

function getApiKey() {
    let key = localStorage.getItem('gemini_api_key');
    if (!key) {
        key = prompt("请输入您的 Google Gemini API Key (如果没有，请访问 aistudio.google.com 获取):");
        if (key) {
            localStorage.setItem('gemini_api_key', key); updateModelSelection(key);
        }
    }
    return key || "";
}


let currentModel = "models/gemini-3-pro-image-preview"; // Default to Image generation model

async function updateModelSelection(apiKey) {
    try {
        const response = await fetch(`https://generativelanguage.googleapis.com/v1beta/models?key=${apiKey}`);
        const data = await response.json();
        if (data.models) {
            const contentModels = data.models.filter(m => m.supportedGenerationMethods && m.supportedGenerationMethods.includes("generateContent"));
            console.log("Available Models:", contentModels.map(m => m.name));
            
            // Prioritize gemini-3-pro-image-preview
            const preferred = contentModels.find(m => m.name.includes("gemini-3-pro-image-preview")) ||
                              contentModels.find(m => m.name.includes("gemini-1.5-flash")) || 
                              contentModels.find(m => m.name.includes("gemini-1.5-pro")) ||
                              { name: "models/gemini-3-pro-image-preview" }; // Fallback to desired model
            
            if (preferred) {
                currentModel = preferred.name;
                console.log("Selected Model:", currentModel);
            }
        }
    } catch (e) {
        console.error("Failed to fetch models list:", e);
    }
}

function init() {
    const k = localStorage.getItem('gemini_api_key'); if(k) updateModelSelection(k); renderQuickPrompts();
    renderStyleGrid();
    setupEventListeners();
    updateUI();
}

// 渲染热门标签
