// 设置事件监听
function setupEventListeners() {
    // 上传按钮
    dom.uploadBtn.addEventListener('click', () => dom.poseInput.click());
    
    // 文件选择
    dom.poseInput.addEventListener('change', async (e) => {
        const file = e.target.files?.[0];
        if (file) {
            try {
                const compressed = await compressImage(file);
                state.poseImage = compressed;
                updateUI();
            } catch (err) {
                alert("图片处理失败");
            }
        }
    });

    // 移除姿态图
    dom.removePoseBtn.addEventListener('click', () => {
        state.poseImage = null;
        dom.poseInput.value = ''; // reset file input
        updateUI();
    });

    // 文本输入
    dom.promptInput.addEventListener('input', (e) => {
        state.promptText = e.target.value;
        dom.charCount.textContent = state.promptText.length;
    });

    // 粘贴处理
    dom.promptInput.addEventListener('paste', async (e) => {
        const items = e.clipboardData?.items;
        if (!items) return;

        for (const item of items) {
            if (item.type.indexOf("image") !== -1) {
                e.preventDefault();
                const file = item.getAsFile();
                if (file) {
                    const compressed = await compressImage(file);
                    state.poseImage = compressed;
                    updateUI();
                }
                break;
            }
        }
    });

    // 生成按钮
    dom.generateBtn.addEventListener('click', handleGenerate);

    // 重置按钮
    dom.resetBtn.addEventListener('click', () => {
        state.poseImage = null;
        state.selectedStyleUrls = [];
        state.promptText = "";
        dom.poseInput.value = "";
        updateUI();
        // 重新渲染风格选中状态
        renderStyleGrid(); 
    });

    // 清空结果
    dom.clearAllBtn.addEventListener('click', () => {
        state.tasks = [];
        updateResultsGrid();
    });

    // 模态框关闭
    dom.closeModalBtn.addEventListener('click', closeModal);
    dom.modalBackdrop.addEventListener('click', closeModal);

    // 下载按钮
    dom.downloadBtn.addEventListener('click', () => {
        if (dom.modalImage.src) {
            downloadImage(dom.modalImage.src);
        }
    });
}

// 逻辑函数：更新 UI 状态
function updateUI() {
    // 姿态图预览
    if (state.poseImage) {
        dom.posePreviewImg.src = state.poseImage;
        dom.posePreviewContainer.classList.remove('hidden');
        dom.uploadBtn.classList.add('active');
        dom.uploadBtnText.textContent = "更换参考图";
    } else {
        dom.posePreviewContainer.classList.add('hidden');
        dom.uploadBtn.classList.remove('active');
        dom.uploadBtnText.textContent = "上传参考图";
    }

    // 文本框
    dom.promptInput.value = state.promptText;
    dom.charCount.textContent = state.promptText.length;

    // 风格选中状态
    const styleItems = document.querySelectorAll('.style-item');
    styleItems.forEach(item => {
        const url = item.dataset.url;
        const index = state.selectedStyleUrls.indexOf(url);
        const badge = item.querySelector('.selection-badge');
        const badgeSpan = item.querySelector('.index-badge');

        if (index !== -1) {
            item.classList.add('selected');
            badge.classList.remove('hidden');
            badgeSpan.textContent = index + 1;
        } else {
            item.classList.remove('selected');
            badge.classList.add('hidden');
        }

        // Disable logic if max selected
        if (!state.selectedStyleUrls.includes(url) && state.selectedStyleUrls.length >= 4) {
            item.classList.add('disabled');
        } else {
            item.classList.remove('disabled');
        }
    });
    dom.styleCount.textContent = state.selectedStyleUrls.length;

    // 热门标签高亮
    const tagBtns = document.querySelectorAll('.tag-btn');
    tagBtns.forEach(btn => {
        if (btn.innerText.includes(state.promptText) && state.promptText !== "") {
            btn.classList.add('active');
        } else {
            btn.classList.remove('active');
        }
    });
}

// 逻辑函数：选择风格
window.toggleStyle = function(url) {
    if (state.selectedStyleUrls.includes(url)) {
        state.selectedStyleUrls = state.selectedStyleUrls.filter(u => u !== url);
    } else {
        if (state.selectedStyleUrls.length >= 4) return;
        state.selectedStyleUrls.push(url);
    }
    updateUI();
};

// 逻辑函数：设置 Prompt
window.setPrompt = function(text) {
    state.promptText = text;
    updateUI();
};

// 逻辑函数：压缩图片
function compressImage(file, maxWidth = 512) {
    return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.onload = (e) => {
            const img = new Image();
            img.onload = () => {
                const canvas = document.createElement("canvas");
                let width = img.width;
                let height = img.height;

                if (width > maxWidth) {
                    height = (height * maxWidth) / width;
                    width = maxWidth;
                }

                canvas.width = width;
                canvas.height = height;

                const ctx = canvas.getContext("2d");
                ctx.drawImage(img, 0, 0, width, height);
                const base64 = canvas.toDataURL("image/jpeg", 0.6);
                resolve(base64);
            };
            img.onerror = reject;
            img.src = e.target.result;
        };
        reader.onerror = reject;
        reader.readAsDataURL(file);
    });
}

// 逻辑函数：将图片 URL 转换为 Base64 (通过 Canvas，绕过 fetch CORS)
function imageUrlToBase64(url) {
    return new Promise((resolve, reject) => {
        if (url.startsWith('data:image')) {
            resolve(url.split(',')[1]);
            return;
        }
        const img = new Image();
        img.crossOrigin = "Anonymous"; // 尝试跨域，虽然 file:// 协议下通常无效，但对 http:// 有用
        img.onload = () => {
            const canvas = document.createElement("canvas");
            canvas.width = img.width;
            canvas.height = img.height;
            const ctx = canvas.getContext("2d");
            ctx.drawImage(img, 0, 0);
            try {
                // toDataURL 默认是 image/png
                const dataURL = canvas.toDataURL("image/png");
                // 去掉前缀 data:image/png;base64,
                const base64 = dataURL.split(",")[1];
                resolve(base64);
            } catch (e) {
                reject(e);
            }
        };
        img.onerror = (e) => reject(new Error(`Failed to load image: ${url}`));
        img.src = url;
    });
}

// 核心逻辑：生成 Prompt
function buildPrompt() {
    const baseDesc = "保持角色一致性，一个卡通风格的黄色圆形表情包，带有粗大的深棕色轮廓线。采用扁平化色彩填充，边缘清晰，描边色值是#F09702，脸部渐变色值是#FFF599到#FFDA48。";
    
    let contentDesc = "";
    if (state.poseImage && state.promptText) {
        contentDesc = `表情包表现出第一张参考图的姿态（忽略角色形象，只取动作），同时${state.promptText}`;
    } else if (state.poseImage) {
        contentDesc = "表情包表现出第一张参考图的姿态（忽略角色形象，只取动作）";
    } else if (state.promptText) {
        contentDesc = `表情包表现出${state.promptText}`;
    } else {
        contentDesc = "表情包表现出开心的样子";
    }

    let styleInstruction = "";
    if (state.selectedStyleUrls.length > 0) {
        const stylePrompts = state.selectedStyleUrls
            .map(url => PRESET_STYLES.find(s => s.url === url)?.prompt)
            .filter(Boolean)
            .join("，");
        
        if (state.poseImage) {
             styleInstruction = `。⚠️视觉风格强制要求：请严格忽略第一张图片（姿态图）的画风和色彩，必须与除第一张以外的所有参考图片保持完全一致的视觉风格${stylePrompts ? `（风格特征：${stylePrompts}）` : ""}。`;
        } else {
             styleInstruction = `。⚠️视觉风格强制要求：请严格保持与所有参考图片完全一致的视觉风格${stylePrompts ? `（风格特征：${stylePrompts}）` : ""}。`;
        }
    }

    return `${baseDesc}${contentDesc}${styleInstruction}。设计简洁可爱，背景为纯深灰色，无其他元素。`;
}

// 核心逻辑：API 调用
// 配置
const CONFIG = {
    // 你的 Rembg 后端服务地址
    // 本地开发通常是: "http://127.0.0.1:8001/remove-bg"
    // 部署到 Zeabur 后，替换为你的 Zeabur 域名，例如: "https://xxx.zeabur.app/remove-bg"
    REMBG_API_URL: "https://faceimg.zeabur.app/remove-bg" 
};

// 移除背景处理函数
async function removeBackground(imageUrl) {
    try {
        console.log("Calling rembg service:", CONFIG.REMBG_API_URL);

        let blob;
        // Convert Data URL to Blob
        if (imageUrl.startsWith("data:")) {
            const arr = imageUrl.split(',');
            const mime = arr[0].match(/:(.*?);/)[1];
            const bstr = atob(arr[1]);
            let n = bstr.length;
            const u8arr = new Uint8Array(n);
            while (n--) {
                u8arr[n] = bstr.charCodeAt(n);
            }
            blob = new Blob([u8arr], { type: mime });
        } else {
            // Not a data URL? Should not happen based on current logic, but handle it
            return imageUrl;
        }

        const formData = new FormData();
        formData.append("file", blob, "image.png");

        const response = await fetch(CONFIG.REMBG_API_URL, {
            method: "POST",
            body: formData
        });

        if (!response.ok) {
            console.warn("Rembg service returned error:", response.status, response.statusText);
            return imageUrl; // Fallback to original
        }

        const resultBlob = await response.blob();
        
        // Convert Blob back to Data URL
        return await new Promise((resolve, reject) => {
            const reader = new FileReader();
            reader.onloadend = () => resolve(reader.result);
            reader.onerror = reject;
            reader.readAsDataURL(resultBlob);
        });

    } catch (error) {
        console.warn("Failed to remove background (is python backend running?):", error);
        return imageUrl; // Fallback to original
    }
}

async function handleGenerate() {
    const taskId = Date.now().toString();
    const task = {
        id: taskId,
        status: 'generating',
        prompt: state.promptText || "默认表情",
        progress: 0,
        imageUrl: null
    };

    state.tasks.unshift(task);
    updateResultsGrid();

    // 模拟进度
    const progressInterval = setInterval(() => {
        const t = state.tasks.find(t => t.id === taskId);
        if (t && t.status === 'generating') {
            t.progress = Math.min(t.progress + Math.random() * 10, 90);
            updateTaskElement(taskId);
        } else {
            clearInterval(progressInterval);
        }
    }, 500);

    try {
        // 改为请求后端 API 代理，隐藏 Key
                const apiKey = getApiKey();
        if (!apiKey) {
            alert("请提供有效的 API Key 以使用生成功能。");
            throw new Error("API Key missing");
        }
        const url = `https://generativelanguage.googleapis.com/v1beta/${currentModel}:generateContent?key=${apiKey}`;

        const prompt = buildPrompt();
        
        // 构建 Parts
        const parts = [{ text: prompt }];

        // 添加姿态图
        if (state.poseImage) {
            const base64Data = state.poseImage.split(',')[1];
            parts.push({
                inline_data: {
                    mime_type: "image/jpeg",
                    data: base64Data
                }
            });
        }

        // 添加风格图
        for (const styleUrl of state.selectedStyleUrls) {
            try {
                const base64 = await imageUrlToBase64(styleUrl);
                parts.push({
                    inline_data: {
                        mime_type: "image/png",
                        data: base64
                    }
                });
            } catch (e) {
                console.error("Failed to load style image", styleUrl, e);
            }
        }

        let response;
        let data;
        let attempt = 0;
        const maxRetries = 3;

        while (attempt < maxRetries) {
            try {
                response = await fetch(url, {
                    method: 'POST',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify({
                        contents: [{ parts }],
                        generationConfig: { responseModalities: ["IMAGE"] }
                    })
                });

                if (response.status === 503) {
                    throw new Error("503 Service Unavailable");
                }

                data = await response.json();
                break; // Success
            } catch (err) {
                attempt++;
                console.warn(`Attempt ${attempt} failed: ${err.message}`);
                
                if (attempt >= maxRetries) {
                    if (err.message.includes("503")) {
                        throw new Error("模型服务繁忙 (503)，请稍后重试。");
                    }
                    throw err;
                }
                
                // Exponential backoff: 2s, 4s, 8s
                await new Promise(resolve => setTimeout(resolve, 2000 * Math.pow(2, attempt - 1)));
            }
        }
        
        clearInterval(progressInterval);

        if (data.error) {
            throw new Error(data.error.message || "生成失败");
        }

        // 解析图片
        // Gemini 返回格式通常是 candidates[0].content.parts[0].inline_data
        // 或者 predictions (如果用了 Vertex AI)
        // 这里按 Gemini API 标准处理
        let imageUrl = null;
        if (data.candidates && data.candidates[0]?.content?.parts) {
             for (const part of data.candidates[0].content.parts) {
                 // Check for both snake_case (standard) and camelCase (sometimes returned by SDKs/Proxies)
                 if (part.inline_data || part.inlineData) {
                     const inlineData = part.inline_data || part.inlineData;
                     const mimeType = inlineData.mime_type || inlineData.mimeType || "image/png";
                     const dataStr = inlineData.data;
                     imageUrl = `data:${mimeType};base64,${dataStr}`;
                     break;
                 }
             }
        } else if (data.predictions && data.predictions[0]?.bytesBase64Encoded) {
            imageUrl = `data:image/png;base64,${data.predictions[0].bytesBase64Encoded}`;
        }

        if (!imageUrl) {
            console.error("Failed to extract image. Full Response:", JSON.stringify(data, null, 2));
            
            if (data.candidates && data.candidates[0]) {
                const candidate = data.candidates[0];
                const reason = candidate.finishReason;
                
                // Check for safety refusal
                if (reason && reason !== "STOP") {
                    throw new Error(`生成被阻止，原因: ${reason} (可能是内容安全过滤)`);
                }

                // Check for text refusal (model explaining why it can't generate)
                if (candidate.content && candidate.content.parts) {
                    const textPart = candidate.content.parts.find(p => p.text);
                    if (textPart) {
                        console.warn("Model returned text instead of image:", textPart.text);
                        throw new Error(`模型拒绝生成图片: "${textPart.text.slice(0, 100)}..."`);
                    }
                }
            }
            
            throw new Error("未返回图片数据 (API 响应有效但无图片内容，请检查控制台详情)");
        }

        // 完成
        const t = state.tasks.find(t => t.id === taskId);
        if (t) {
            t.status = 'generating'; // Keep generating while removing background
            t.progress = 95;
            updateTaskElement(taskId);

            // 尝试去除背景
            const processedImageUrl = await removeBackground(imageUrl);
            
            t.status = 'completed';
            t.imageUrl = processedImageUrl;
            t.progress = 100;
        }

    } catch (err) {
        clearInterval(progressInterval);
        const t = state.tasks.find(t => t.id === taskId);
        if (t) {
            t.status = 'failed';
            t.error = err.message;
        }
        console.error(err);
    }

    updateResultsGrid();
}

// 渲染结果网格
function updateResultsGrid() {
    const grid = dom.resultsGrid;
    const generatingCount = state.tasks.filter(t => t.status === 'generating').length;
    
    // 更新 badge
    if (generatingCount > 0) {
        dom.generatingCountBadge.textContent = generatingCount;
        dom.generatingCountBadge.classList.remove('hidden');
    } else {
        dom.generatingCountBadge.classList.add('hidden');
    }

    // 更新结果总数
    dom.resultCount.textContent = `(${state.tasks.length})`;
    dom.resultCount.classList.toggle('hidden', state.tasks.length === 0);
    dom.clearAllBtn.classList.toggle('hidden', state.tasks.length === 0);

    if (state.tasks.length === 0) {
        grid.innerHTML = `
            <div class="empty-state">
                <div class="emoji-icon">🎨</div>
                <p>等待生成</p>
                <span>选择参考或输入描述后点击生成</span>
            </div>
        `;
        grid.classList.add('empty');
        return;
    }

    grid.classList.remove('empty');
    grid.innerHTML = state.tasks.map(task => `
        <div class="result-card" onclick="openModal('${task.id}')">
            ${renderTaskContent(task)}
        </div>
    `).join('');
}

// 渲染单个任务卡片内容
function renderTaskContent(task) {
    if (task.status === 'generating') {
        return `
            <div class="generating-overlay">
                <div class="spinner"></div>
                <p>${Math.round(task.progress)}%</p>
                <div class="progress-bar">
                    <div class="progress-fill" style="width: ${task.progress}%"></div>
                </div>
            </div>
        `;
    } else if (task.status === 'completed') {
        return `<img src="${task.imageUrl}" alt="${task.prompt}" loading="lazy">`;
    } else {
        return `
            <div class="failed-overlay">
                <i data-lucide="alert-circle" style="width: 24px; margin-bottom: 8px;"></i>
                <p>生成失败</p>
                <button class="retry-btn" onclick="retryTask(event, '${task.id}')">重试</button>
            </div>
        `;
    }
}

// 仅仅更新 DOM 中变化的进度，防止整个重绘 (可选优化)
function updateTaskElement(taskId) {
    // 简单起见，这里直接调用全量刷新，因为 react 下也是这样的逻辑
    updateResultsGrid();
}

// 模态框逻辑
window.openModal = function(taskId) {
    const task = state.tasks.find(t => t.id === taskId);
    if (!task || task.status !== 'completed') return;

    dom.modalImage.src = task.imageUrl;
    dom.modalPrompt.textContent = task.prompt;
    dom.imageModal.classList.remove('hidden');
};

function closeModal() {
    dom.imageModal.classList.add('hidden');
}

// 下载图片
function downloadImage(dataUrl) {
    const link = document.createElement('a');
    link.href = dataUrl;
    link.download = `emoji-${Date.now()}.png`;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
}

// 重试
window.retryTask = function(event, taskId) {
    event.stopPropagation();
    const task = state.tasks.find(t => t.id === taskId);
    if (task) {
        state.tasks = state.tasks.filter(t => t.id !== taskId);
        state.promptText = task.prompt; 
        updateUI();
        handleGenerate(); // Re-trigger
    }
};

// 启动
init();
